import React, { Component } from "react";
import MapboxControl from "../map/MapboxControl";
import GeoJSONData from "../map/mapbox/sources/GeoJSONData";

import parkingSensorData from "./On-street_Parking_Bay_Sensors";
import worldPointData from "../../data/geojson/point/admin_0.json";
import readCSV from "../map/mapbox/sources/readCSV";
import Marker from "../map/mapbox/markers/Marker";
import GeoCoderControl from "../map/mapbox/GeoCoderControl";

const GREEN_PIN = 'data:image/png;base64,'
const RED_PIN = 'data:image/png;base64,';

class Map extends Component {
  constructor({ }) {
    super({ });
  }

  render() {
    return <>
      <GeoCoderControl onResultSelected={result => console.log(JSON.stringify(result))}
                     onResults={results => console.log(JSON.stringify(results))} />
      <MapboxControl ref={el => {this.__mapboxControl = el;}}
                     style={{height: "50vh"}} />
    </>;
  }

  componentDidMount() {
    //let geoJSONData = new GeoJSONData(GeoJSONData.POINTS, worldPointData);
    for (let sensor of readCSV(parkingSensorData)) {
      let long = parseFloat(sensor['lon']);
      let lat = parseFloat(sensor['lat']);
      if (sensor['status'] === 'Unoccupied') {
        new Marker(this.__mapboxControl, GREEN_PIN, long, lat)
      } else if (sensor['status'] === 'Present') {
        new Marker(this.__mapboxControl, RED_PIN, long, lat)
      }
    }
    //geoJSONData.joinDataOnKey(csvData)
  }
}

export default Map;

