                            className="form-input"
                            style={{ maxWidth: "320px" }}
                            type="email"
                            name="email"
                            onChange={handleChange}
                            onBlur={handleBlur}
                            value={values.email}
                          /></FlexRow>
                          {errors.email && touched.email && errors.email}

                          <FlexRow style={{ justifyContent: "center" }}><label className="form-label">Phone</label></FlexRow>
